import React from 'react';
import './Stock.css';

export default function Stock(props) {
    return(
    <>
        <div className='topspcae'>
        <div className='responsive'>
            <div className='gallery'>
            <a href={props.hre} target="blank">
                <img src= {props.sr} alt="Forest" width="600" height="400"/>
            </a>
                <div className='desc'>{props.des}</div>
                <div className='de'><span>Tag :</span><span> {props.de}</span></div>
                <div className='desce'><span>&#8377;</span><span> {props.pr}</span></div>
            </div>
        </div></div>
    </>
    )
}
